import Header from "./Header"
import Home from "./Home"

import React from 'react'
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";


function App() {
  return (
    <Router>
      <div className="App">
        <Switch>
          <Route path="/login">

          </Route>

          <Route path="/checkout">
            <Header />

          </Route>

          <Route path="/">

            <Header />
            <Home />
          </Route>
        </Switch>
      </div>
    </Router>
  );
}

export default App;
